import React from 'react';
import Header from './Findztask/Header';
import Main from './Findztask/Main';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Moviedetails from './Findztask/Moviedetails';



function App() {
  return (
  <>
  <div className="container">
 <Header/>
	 <BrowserRouter>
	 <Main/>
				<Routes>

				  <Route exact path='/moviedetails' element={<Moviedetails/>}/>
				</Routes>
	</BrowserRouter>




 </div>

  </>
  );
}

export default App;
